import React from 'react';
import { Card } from 'react-bootstrap';
import '../card.css';

export default function CollectionsCard(props) {

  const cardStyle = {
    width: "200px",
    justifyContent: "left",
    borderRadius: "5px",
    border: "solid black",
    borderWidth: "100%",
    margin: "20px",
    cursor: "pointer"
  }

  return (
    <div className="container">
      <ul className="grid_list">
        {props.collections.map(item =>
          <li>
            <Card style={cardStyle}>
              <img src={item.collection.image_url} alt="dine-pic" />
              <h6>{item.collection.title}</h6>
            </Card>
          </li>
        )}
      </ul >
    </div >
  )
}
